import React, { useState } from 'react';
import { Search, Grid, List } from 'lucide-react';
import AppLayout from './app-layout';
import { Link } from 'react-router-dom';

const CataloguePage = () => {
  const [viewMode, setViewMode] = useState('grid');
  const [searchQuery, setSearchQuery] = useState('');
  const [filters, setFilters] = useState({
    type: 'all',
    energy: 'all',
    priceRange: 'all',
  });

  const vehicles = [
    {
      id: 1,
      name: 'Tesla Model 3',
      type: 'automobile',
      energy: 'electric',
      price: 42900,
      image: '/api/placeholder/800/600',
      description: 'Berline électrique performante',
    },
    {
      id: 2,
      name: 'Vespa Elettrica',
      type: 'scooter',
      energy: 'electric',
      price: 7499,
      image: '/api/placeholder/800/600',
      description: 'Scooter électrique urbain',
    },
  ];

  const filteredVehicles = vehicles.filter((vehicle) => {
    const matchesSearchQuery = vehicle.name.toLowerCase().includes(searchQuery.toLowerCase());
    const matchesTypeFilter = filters.type === 'all' || vehicle.type === filters.type;
    const matchesEnergyFilter = filters.energy === 'all' || vehicle.energy === filters.energy;
    const matchesPriceRangeFilter =
      filters.priceRange === 'all' ||
      (filters.priceRange === '0-10000' && vehicle.price <= 10000) ||
      (filters.priceRange === '10000-30000' && vehicle.price >= 10000 && vehicle.price <= 30000) ||
      (filters.priceRange === '30000+' && vehicle.price > 30000);

    return matchesSearchQuery && matchesTypeFilter && matchesEnergyFilter && matchesPriceRangeFilter;
  });

  const VehicleCard = ({ vehicle, isList }) => {
    return isList ? (
      <div className="bg-gray-800 border border-gray-700 rounded-lg flex overflow-hidden shadow hover:shadow-lg transition">
        <img
          src={vehicle.image}
          alt={vehicle.name}
          className="w-60 h-40 object-cover"
        />
        <div className="p-4 flex-1 flex flex-col justify-between">
          <div>
            <h3 className="text-xl font-semibold text-blue-400">{vehicle.name}</h3>
            <p className="text-gray-400 mt-2">{vehicle.description}</p>
            <div className="flex gap-2 mt-4">
              <span className="px-3 py-1 bg-gray-700 text-sm rounded-full">{vehicle.type}</span>
              <span className="px-3 py-1 bg-gray-700 text-sm rounded-full">{vehicle.energy}</span>
            </div>
          </div>
          <div className="flex justify-between items-center mt-4">
            <span className="text-lg font-bold text-blue-400">{vehicle.price.toLocaleString()} €</span>
            <Link
              to={`/vehicle/${vehicle.id}`}
              className="px-4 py-2 bg-blue-600 text-sm rounded-md hover:bg-blue-700 transition"
            >
              Voir détails
            </Link>
          </div>
        </div>
      </div>
    ) : (
      <div className="bg-gray-800 rounded-lg overflow-hidden shadow-lg hover:shadow-xl transition">
        <img
          src={vehicle.image}
          alt={vehicle.name}
          className="w-full h-48 object-cover"
        />
        <div className="p-4">
          <h3 className="text-xl font-semibold text-blue-400">{vehicle.name}</h3>
          <p className="text-gray-400 mt-2">{vehicle.description}</p>
          <div className="flex justify-between items-center mt-4">
            <span className="text-lg font-bold text-blue-400">{vehicle.price.toLocaleString()} €</span>
            <Link
              to={`/vehicle/${vehicle.id}`}
              className="px-4 py-2 bg-blue-600 text-sm rounded-md hover:bg-blue-700 transition"
            >
              Voir détails
            </Link>
          </div>
        </div>
      </div>
    );
  };

  return (
    <AppLayout>
      <div className="space-y-6">
        {/* Search & View Controls */}
        <div className="flex justify-between items-center gap-4">
          <div className="relative flex-1">
            <input
              type="text"
              placeholder="Rechercher un véhicule..."
              className="w-full pl-10 pr-4 py-2 bg-gray-800 border border-gray-700 rounded-lg focus:ring-blue-500 focus:border-blue-500"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
            />
            <Search className="absolute left-3 top-2.5 h-5 w-5 text-gray-400" />
          </div>
          <div className="flex space-x-2">
            <button
              onClick={() => setViewMode('grid')}
              className={`p-2 rounded-md ${viewMode === 'grid' ? 'bg-blue-600' : 'bg-gray-700'}`}
            >
              <Grid className="h-5 w-5 text-white" />
            </button>
            <button
              onClick={() => setViewMode('list')}
              className={`p-2 rounded-md ${viewMode === 'list' ? 'bg-blue-600' : 'bg-gray-700'}`}
            >
              <List className="h-5 w-5 text-white" />
            </button>
          </div>
        </div>

        {/* Vehicles Grid/List */}
        <div className={`grid gap-6 ${viewMode === 'grid' ? 'grid-cols-1 sm:grid-cols-2 lg:grid-cols-3' : 'grid-cols-1'}`}>
          {filteredVehicles.map((vehicle) => (
            <VehicleCard key={vehicle.id} vehicle={vehicle} isList={viewMode === 'list'} />
          ))}
        </div>
      </div>
    </AppLayout>
  );
};

export default CataloguePage;
